		#region IWordlistSource Members

		public Task<Wordlist> Load(string name)
		{
			var list = _WordLists.TryGet(name);
			if(list == null)
				return null;
			return Task.FromResult(new Wordlist(list.Split(new string[] { "\n" }, StringSplitOptions.RemoveEmptyEntries),
				name == "japanese" ? '　' : ' ', name
				));
		}

